import FlexBetween from "./FlexBetween";
import { Box, Button } from "@mui/material"


const PlayButton = () => {
    
    return(
        <FlexBetween>
            <Box>
                <Button fontSize="50px" variant="outlined" width="6rem" height="100%"><h1>PLAY</h1></Button>
            </Box>
            
        </FlexBetween>
    );
}
export default PlayButton;
